// EarthLexerInit initializes any static state used to implement EarthLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewEarthLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func EarthLexerInit() {
  staticData := &earthlexerLexerStaticData
  staticData.once.Do(earthlexerLexerInit)
}

// NewEarthLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewEarthLexer(input antlr.CharStream) *EarthLexer {
  EarthLexerInit()
	l := new(EarthLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
  staticData := &earthlexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.predictionContextCache)
	l.channelNames = staticData.channelNames
	l.modeNames = staticData.modeNames
	l.RuleNames = staticData.ruleNames
	l.LiteralNames = staticData.literalNames
	l.SymbolicNames = staticData.symbolicNames
	l.GrammarFileName = "EarthLexer.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

